import React from "react";
import { Container } from "react-bootstrap";

const About = () => {
  return (
    <section id="about-us">
      <Container
        fluid
        style={{
          paddingTop: "5rem",
          backgroundColor: "#EBBFF3",
          width: 1577,
          height: 700,
          textAlign: "center",
          fontFamily: "primary-font",
        }}
      >
        <h1 style={{ fontSize: 55 }}>Designers.Developers.Nuub</h1>
        <p
          style={{
            fontSize: 25,
            width: "70%",
            marginTop: "2rem",
            marginLeft: "13rem",
            fontFamily: "secondary-font",
          }}
        >
          This is us. Everyday proud of our profession, training and experience
          behind us, ready to deliver the best of your product!
        </p>
      </Container>
    </section>
  );
};

export default About;
